// File contracts/EraApeWarriors.sol


pragma solidity ^0.8.11;
contract Stickman is ERC721A, Ownable {
    using Address for address payable;
    using Strings for uint256;

    string public contractURI="ipfs://Qmbo7LoE9WmDMbyqtXwjFgjfh15RgYeLajHVotf6ZAYAcv";
    string private _baseTokenURI= "ipfs://QmeqZHDrVuMK5g63Y7iW7uKXiLKhAGahrwNEdzQud6TGfk/";
    bool private _saleStatus = false;
    uint256 private _salePrice = 0;
    uint256 private _teamSupply = 0;
    uint256 private _reservedSupply;

    uint256 public MAX_SUPPLY = 10000;
    uint256 public FREE_PER_WALLET = 0;
    uint256 public MAX_MINTS_PER_TX = 100;
    uint256 public MAX_PER_WALLET = 100;

    constructor() ERC721A("Stickman", "StickmanNFT") {}

    modifier callerIsUser() {
        require(tx.origin == msg.sender, "The caller is another contract");
        _;
    }

    function setBaseURI(string calldata newBaseURI) external onlyOwner {
        _baseTokenURI = newBaseURI;
    }

    function setContractURI(string calldata _contractURI) external onlyOwner {
        contractURI = _contractURI;
    }


    function setMaxMintPerTx(uint256 maxMint) external onlyOwner {
        MAX_MINTS_PER_TX = maxMint;
    }

    function setSalePrice(uint256 price) external onlyOwner {
        _salePrice = price;
    }

    function toggleSaleStatus() external onlyOwner {
        _saleStatus = !_saleStatus;
    }


    function withdraw() public onlyOwner {
        uint256 balance = address(this).balance;
        (bool os, ) = payable(msg.sender).call{value: balance}("");
        require(os);
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return _baseTokenURI;
    }

    function _startTokenId() internal pure override returns (uint256) {
        return 1;
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "URI query for nonexistent token");

        return string(abi.encodePacked(_baseTokenURI, tokenId.toString(), ".json"));
    }

    function trackUserMinted(address minter) external view returns (uint32 userMinted) {
        return uint32(_numberMinted(minter));
    }        

    function mint(uint256 quantity)
        external
        payable
        callerIsUser
    {
        uint256 userMintCount = uint256(_numberMinted(msg.sender));
        uint256 freeQuantity = 0;

        if (userMintCount < FREE_PER_WALLET) {
            uint256 freeLeft = FREE_PER_WALLET - userMintCount;
            freeQuantity += freeLeft > quantity ? quantity : freeLeft;
        }

        uint256 totalPrice = (quantity - freeQuantity) * _salePrice;

        if (totalPrice > msg.value)
            revert("APE: Insufficient fund");

        if (!isSaleActive()) revert("APE: Sale not started");

        if (quantity > MAX_MINTS_PER_TX)
            revert("APE: Amount exceeds transaction limit");
        if (quantity + userMintCount > MAX_PER_WALLET)
            revert("APE: Amount exceeds wallet limit");
        if (totalSupply() + quantity > (MAX_SUPPLY))
            revert("APE: Amount exceeds supply");

        _safeMint(msg.sender, quantity);
        if (msg.value > totalPrice) {
            payable(msg.sender).sendValue(msg.value - totalPrice);
        }              
    }

    function airdropMint(uint256 quantity) external onlyOwner {
        require(totalSupply() + quantity <= MAX_SUPPLY, "APE: Amount exceeds supply");

        _safeMint(msg.sender, quantity);
    }

    function walletOfOwner(address _owner)
        external
        view
        returns (uint256[] memory)
    {
        uint256 ownerTokenCount = balanceOf(_owner);
        uint256[] memory ownedTokenIds = new uint256[](ownerTokenCount);
        uint256 currentTokenId = 1;
        uint256 ownedTokenIndex = 1;
        while (
            ownedTokenIndex < ownerTokenCount && currentTokenId <= totalSupply()
        ) {
            address currentTokenOwner = ownerOf(currentTokenId);
            if (currentTokenOwner == _owner) {
                ownedTokenIds[ownedTokenIndex] = currentTokenId;
                ownedTokenIndex++;
            }
            currentTokenId++;
        }
        return ownedTokenIds;
    }

    function mintToAddress(address to, uint256 quantity) external onlyOwner {
        if (totalSupply() + quantity > MAX_SUPPLY)
            revert("APE: Amount exceeds supply");

        _safeMint(to, quantity);
    }

    function isSaleActive() public view returns (bool) {
        return _saleStatus;
    }

    function getSalePrice() public view returns (uint256) {
        return _salePrice;
    }

}
